 alters iron and manganese uptake and regulation of surface transferrin receptors in primary rat oligodendrocyte cultures . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 ( Tf ) is a major transport protein for both iron ( Fe ) and aluminum ( Al ) , as well as manganese ( Mn ) and it can mediate cellular uptake of these elements via cell surface Tf receptors . To study the effect of Al-Tf on Tf receptor regulation , primary oligodendrocyte cultures were prepared from cortices of newborn rats . The effects of Al-Tf on 54Mn and 59Fe uptake were compared to those of apo - , Fe - , or Mn-Tf ( 1.25 microM ) . To examine changes in cell surface Tf binding capacity , preincubation ( 4 h , 37 degrees C ) was performed with apo - , Al - or Fe-Tf and homologous receptor binding studies were subsequently conducted with 125I - Fe-Tf at 4 degrees C . Incubation with Al-Tf , but not with equimolar amounts of Al chloride or Al citrate , led to dose-related increases in cellular Al . Incubation with either Al - or Fe-Tf decreased 59Fe uptake , while incubation with either Al - or Mn-Tf decreased 54Mn uptake . Surface Tf receptor sites / cell were 1.05 , 0.60 and 0.46 x 10 ( 5 ) after incubations with equivalent amounts of apo - , Fe - , and Al-Tf respectively . The data suggest that Al-Tf down-regulates surface Tf receptors on oligodendrocytes and can limit Fe and Mn uptake through this mechanism .</div>

 , in this disease . We now demonstrate that the myelosuppressive cytokines TNFalpha and IL - 1beta are secreted by bone marrow ( BM ) cells in a p38 MAPK-dependent manner . Their secretion is stimulated by paracrine interactions between BM stromal and mononuclear cells and cytokine induction correlates with

 and methionine . Human patients with methionine synthase deficiency exhibit homocysteinemia , homocysteinuria , and hypomethioninemia . They suffer from megaloblastic anemia with or without some degree of neural dysfunction and mental retardation . To better study the pathophysiology of methionine synthase deficiency , we utilized gene-targeting technology to inactivate the methionine synthase gene in mice . On average , heterozygous knockout mice from an outbred background have slightly elevated plasma homocysteine and methionine compared to wild-type mice but seem to be otherwise indistinguishable . Homozygous knockout embryos survive through implantation but die soon thereafter . Nutritional supplementation during pregnancy was unable to rescue embryos that were completely deficient in methionine synthase . Whether any human patients with methionine synthase deficiency have a complete absence of enzyme activity is unclear . These results demonstrate the importance of this enzyme for early development in mice and suggest either that methionine synthase-deficient patients have residual methionine synthase activity or that humans have a compensatory mechanism that is absent in mice .</div>
